import React from "react";
import { Link } from "react-router-dom";

const FinancePage = () => {
  return (
    <div className="flex flex-col min-h-screen">
      
      {/* ✅ Barre de navigation */}
      <header className="bg-white shadow-md py-4 fixed top-0 w-full z-50">
        <div className="container mx-auto flex items-center justify-between px-6">
          <div className="text-3xl font-extrabold text-gray-800 tracking-wide font-serif">
            <Link to="/" className="text-gray-800 hover:text-blue-600">Slim<span className="text-blue-600">Data</span></Link>
          </div>
          <nav className="flex flex-1 justify-center space-x-6">
            <Link to="/expertises" className="nav-btn">Expertises</Link>
            <Link to="/secteurs" className="nav-btn">Secteurs</Link>
            <Link to="/contact" className="nav-btn bg-blue-600 text-white">Contact</Link>
          </nav>
        </div>
      </header>

      {/* ✅ Contenu */}
      <main className="container mx-auto py-24 px-6 flex-grow">
        <h1 className="text-4xl font-bold text-gray-800 text-center mb-6">Secteur Finance</h1>
        <p className="text-gray-600 text-center mb-12">
          L'IA au service de la finance pour l'analyse des marchés et la prévention des fraudes.
        </p>
      </main>

      {/* ✅ Footer */}
      <footer className="bg-gray-900 text-white text-center p-6 mt-auto">
        <p>&copy; 2024 SlimData. Tous droits réservés.</p>
      </footer>
    </div>
  );
};

export default FinancePage;
